import React from "react";
import { Navigation, Pagination, Scrollbar, A11y } from "swiper";
import { Swiper, SwiperSlide } from "swiper/react";
// import required modules
import { Autoplay } from "swiper";

// Import Swiper styles
import "swiper/css";
import "swiper/css/navigation";
import "swiper/css/pagination";
import "swiper/css/scrollbar";

import "./MomentPicSlide.css";

import CardMoment from "./cardMoment";
import dataLifeEvents from "./dataMoments";

import img1 from "./life_events/18.jpeg";

const MomentPicSlide = () => {
  console.log(val.img);
  return (
    <>
      <section>
        <div className="moment_pic">
          <div className="life-event">Life Events....</div>
          <div>
            <div>
              <Swiper
                modules={[Autoplay, Navigation, Pagination, Scrollbar, A11y]}
                rebuildOnUpdate={true}
                spaceBetween={50}
                slidesPerView={1}
                loop={true}
                loopFillGroupWithBlank={true}
                navigation
                pagination={{ clickable: true }}
                // scrollbar={{ draggable: true }}
                // onSwiper={(swiper) => console.log(swiper)}
                // onSlideChange={() => console.log("slide change")}
                centeredSlides={true}
                autoplay={{
                  delay: 2000,
                  disableOnInteraction: false,
                }}
                // className="mySwiper"
              >
                {dataLifeEvents.map((val, i) => {
                  <SwiperSlide>
                    <img src={val.img} alt={val.id} />
                  </SwiperSlide>;
                })}
              </Swiper>

              {/* {dataLifeEvents.map((val, index) => {
                console.log(val.img);
                return (
                  <CardMoment
                    key={index}
                    path={val.img}
                    description={val.description}
                    id={val.id}
                  />
                );
              })} */}
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default MomentPicSlide;
